  return (
    <h1>
     {props.course}
    </h1>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>
        {props.part1} {props.exercises1}
      </p>
      <p>
        {props.part2} {props.exercises2}
      </p>
      <p>
        {props.part3} {props.exercises3}
      </p>
    </div>
  )
}

const Total = (props) => {
  return (
    <p>
     Number of exercises {props.exercises1 + props.exercises2 + props.exercises3}
    </p>
  )
}

